I had seen Chloi eating at the same pizzeria pretty frequently by one of my stomping grounds throughout the summer. I decided to pull the trigger and try to bag her. I had laid the ground work pretty effectively with the occasional small talk and sporadic, well placed flirts here and there and she agreed to have a slice with me at her favorite pizza spot. She excused herself to the bathroom and I used the opportunity to text Ash and have him meet us at the pizza shop right away to tag and bag this luscious Latina. It all went according plan and she was a blast. Well, I was a blast... all over her mouth. HUNTED.
